import React from 'react';
import SavedCard from "./SavedCards";
const cityUrl = 'http://localhost:3000/cities'


const CardContainer = () => {
	state={
        allCards:[]
    }


  componentDidMount = () => {
    fetch(cityUrl)
      .then(res => res.json())
      .then(data => this.setState({allCards:data}))
  }


	return (
		<div>
			<h1>Saved Cards:</h1>
			<SavedCard allCards={this.state} />
		</div>
	);
}


export default CardContainer;
